inp = '    '
#inp = 'ULL RRDDD LURDL UUUUD'
instructions = inp.split(' ')
curr = [1,3]
for instruc in instructions:
    for ch in instruc:
        if 'U' == ch and curr[1] > 1:
            if curr[1] is 1:
                curr = [3,1]
            elif curr[1] is 2:
                if curr[0] is 3:
                    curr[1] = curr[1] - 1
            elif curr[1] is 3:
                if curr[0] > 1 and curr[0] < 5:
                    curr[1] = curr[1] - 1
            elif curr[1] is 4:
                if curr[0] > 1 and curr[0] < 5:
                    curr[1] = curr[1] - 1
            elif curr[1] is 5:
                if curr[0] is 3:
                    curr[1] = curr[1] - 1
        elif 'D' == ch and curr[1] < 5:
            if curr[1] is 1:
                if curr[0] is 3:
                    curr[1] = curr[1] + 1
            elif curr[1] is 2:
                if curr[0] > 1 and curr[0] < 5:
                    curr[1] = curr[1] + 1
            elif curr[1] is 3:
                if curr[0] > 1 and curr[0] < 5:
                    curr[1] = curr[1] + 1
            elif curr[1] is 4:
                if curr[0] is 3:
                    curr[1] = curr[1] + 1
            elif curr[1] is 5:
                curr = [3,5]
        elif 'L' == ch and curr[0] > 1:
            if curr[1] is 1:
                curr = [3,1]
            elif curr[1] is 2:
                if curr[0] > 2:
                    curr[0] = curr[0] - 1
            elif curr[1] is 3:
                if curr[0] > 1:
                    curr[0] = curr[0] - 1
            elif curr[1] is 4:
                if curr[0] > 2:
                    curr[0] = curr[0] - 1
            elif curr[1] is 5:
                curr = [3,5]
        elif 'R' == ch and curr[0] < 5:
            if curr[1] is 1:
                curr = [3,1]
            elif curr[1] is 2:
                if curr[0] < 4:
                    curr[0] = curr[0] + 1
            elif curr[1] is 3:
                if curr[0] < 5:
                    curr[0] = curr[0] + 1
            elif curr[1] is 4:
                if curr[0] < 4:
                    curr[0] = curr[0] + 1
            elif curr[1] is 5:
                curr = [3,5]
    print(curr)
